a:260:{i:0;a:1:{s:2:"id";s:19:"2391145690427261400";}i:1;a:1:{s:10:"short_code";s:11:"CEvDlYsH4HY";}i:2;a:1:{s:12:"created_time";i:1599266800;}i:3;a:1:{s:7:"caption";s:1913:"Fact checking presidential candidate Joe Biden claim that a Black man had invented the light bulb, not "a White guy named Edison."

No, a Black man didn't invent the light bulb. But Lewis Howard Latimer made it better.

Edison's bulb

Beginning in 1878, Thomas Edison spent over a year trying to develop an incandescent light bulb using electricity to heat a thin filament. Edison's bulb looked a lot like what we're used to -- a filament in a glass bulb, according toÂ the Franklin Institute.

But after years of experiments and thousands of tests of various filament materials, his longest-lasting light bulb could only last for about 15 hours before the filament burned out.

Latimer's improvements

Around the same time Edison was experimenting with his bulb -- using carbonized filaments of bay wood, cedar, bamboo and other fibers -- so was Latimer.

Born just a year after Edison in 1848, Latimer was an inventor known for working closely with Alexander Graham Bell, who invented the telephone (though some claim that invention is actually Latimer's).

According to theÂ Massachusetts Institute of Technology, Latimer improved upon Edison's original design. Latimer created a light bulb with a more durable filament made of carbon. He sold the patent to the US Electric Co.

In 1881, and a year later patented a process for efficiently manufacturing the carbon filament. He even wrote a book in 1890 on electric lighting, the first of its kind.

Because of Latimer's contributions, incandescent light bulbs became more affordable and practical, MIT says, thus transforming American culture.

